    public static void runJS() throws FileNotFoundException, ScriptException, NoSuchMethodException {
        ScriptEngine engine = new ScriptEngineManager().getEngineByName("nashorn");
        String path = NashornTest.class.getResource("/crypto-js.min.js").getPath();//获取文件路径
        engine.eval(new FileReader(new File(path)));//执行文件
        Invocable invocable = (Invocable) engine;
        Object result = invocable.invokeFunction("getData");//调用js中函数
        System.out.println("返回结果: "+result);

    }
    
